import './Footer.css';
const Footer = () => {

  return (
    <div>
        <footer>
            
               <p>Contact me at <strong>mahalkokayolahat@gmail.com</strong></p>
               <p>123 Biglang Liko St. Nawawala Circle, Cebu City</p>
               <p>09010696910</p>
            
        </footer>
    </div>
  )
}

export default Footer
